import React from 'react'

export default function Pagination() {

    let pageNumber = new Array(5).fill(1).map((e,index)=>index+1)
  return (
 <nav aria-label="Page navigation example">
  <ul className="pagination">
    <li className="page-item"><span className="page-link" >Previous</span></li>
    {pageNumber.map((num,index)=>
    <li className="page-item"><span className="page-link" >{num}</span></li>)}
    <li className="page-item"><span className="page-link" >Next</span></li>
  </ul>
</nav>

  )
}
